import { Component } from 'react';

import logo from './logo.svg';
import './App.css';

class App extends Component {
  constructor() {
    super();

    this.state = {
      name: { firstName: 'Chase', lastName: 'Struse' },
      company: 'Snoodle Studios'
    };
  }

  render() {
    return (
      <div className="App">
        <header className="App-header">
          <img src={logo} className="App-logo" alt="logo" />
          <p> 
            Hi {this.state.name.firstName} {this.state.name.lastName} , I work at {this.state.company}</p>
          <button onClick={() => {
            this.setState(
              () => {
              return {
                name: { firstName: 'Courtney', lastName: 'Marsh'},
                };
              });
            }}
          > 
            Change Name45
          </button>
        </header>
      </div>
    );
  }

}

export default App;
